import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Button from '@material-ui/core/Button';
import Link from 'next/link'


const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,

    },
    menuButton: {
        marginRight: theme.spacing(2),
    },
    title: {
        flexGrow: 1,
    },

}));


function ButtonAppBar() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <AppBar position="static" style={{backgroundColor: '#0174DF'}}>
                <Toolbar>
                    <img src={"http://icons.iconarchive.com/icons/graphicloads/colorful-long-shadow/72/Car-icon.png"}
                         alt="Logo"/>
                    <h1 style={{margin: '0 5px'}}>Car Record</h1>
                    <Button >
                        <Link href="/ManageAdmin"><h3 style={{fontcolor: '#FFFFFF'}} >Manage Admin</h3></Link>
                    </Button>
                </Toolbar>

            </AppBar>
        </div>
    );
}

export default ButtonAppBar;
